                array (1, 102866, 1, 'Reserve Bid'),
                array (1, 103002, 1, 'no+bids'),
                array (1, 103056, 1, '%3Cfont+color%3D%22%23000000%22+face%3D%22Arial%2C+Helvetica%2C+sans-serif%22+size%3D%222%22%3EEvery+auction+on+this+site+will+either+be+a+%22standard+auction%22+or+a+%22dutch+auction%22.+When+the+seller+only+has+one+item+to+list+in+the+auction%2C+it+will+be+a+%22standard+auction%22.+Typically%2C+when+the+seller+has+two+or+more+of+an+identical+item%2C+it+will+be+a+%22dutch+auction%22.++These+two+auction+types+of+are+described+below%3A%0D%0A%3Cbr%3E%3Cbr%3E%0D%0A%3Cb%3ESTANDARD+AUCTION%3A%3C%2Fb%3E%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AIn+a+standard+auction+all+bidders+bid+against+each+other%2C+and+the+highest+bidder+at+the+end+of+the+auction+is+the+winner+of+the+item%2C+assuming+the+winning+bid+has+surpassed+the+%22reserve+amount%22+as+specified+by+the+seller+when+the+seller+listed+the+auction.+In+a+standard+auction+there+is+only+ONE+winning+bidder.%0D%0A%3Cbr%3E%3Cbr%3E%0D%0A%3Cb%3EDUTCH+AUCTION%3A%3C%2Fb%3E%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AIn+a+dutch+auction+the+seller+is+offering+two+or+more+of+an+identical+item+for+auction.+Unlike+a+standard+auction%2C+a+dutch+auction+MAY+HAVE+MORE+THAN+ONE+winning+bidder.+%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AEach+bidder+bids+on+either+all%2C+or+a+desired+number+of+the+auction+items%2C+and+indicates+the+price+that+he%2Fshe+is+willing+to+pay+for+each+of+item.+At+the+end+of+the+auction%2C+all+winning+bidders+will+pay+the+same+price+for+each+of+their+items%2C+which+is+the+lowest+qualifying+%28successful%29+bid.+If+there+are+more+successful+bids+than+items+available%2C+priority+goes+to+the+bidders+who+submitted+their+bids+first.+%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AIn+order+to+beat+another+bidder%2C+a+bid+must+simply+have+a+higher+total+bid+price+per+item+than+the+other+bids%2C+regardless+on+the+number+of+items+that+are+being+bid+on.%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AHere+is+an+example+of+how+this+might+work%3A%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AThe+seller+listed+a+dutch+auction+with+5+identical+items.%0D%0A%3Cbr%3E%3Cbr%3E%0D%0A%3E+Bidder+%22A%22+placed+a+bid+for+2+items+at+%2420+each.%0D%0A%3Cbr%3E%0D%0A%3E+Bidder+%22B%22+placed+a+bid+for+4+items+at+%2421+each.%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AThe+outcome+of+this+auction+would+be%3A%0D%0A%3Cbr%3E%3Cbr%3E%0D%0A%3E+Bidder+%22B%22+wins+4+items+at+%2420+each%0D%0A%3Cbr%3E%0D%0A%3E+Bidder+%22A%22+wins+1+item+at+%2420+each%0D%0A%3Cbr%3E%3Cbr%3E%0D%0AThe+%2420+price+is+because+the+lowest+successful+bid+was+%2420.+The+total+items+were+awarded+based+upon+Bidder+B%27s+willingness+to+bid+a+higher+dollar+amount+than+Bidder+A.%0D%0A%3Cbr%3E%3Cbr%3E%0D%0ASince+Bidder+%22A%22+was+only+awarded+%221%22+item%2C+and+his+original+bid+was+for+%222%22+items%2C+he+has+the+right+to+refuse+the+purchase+of+that+partial+order.%0D%0A%3Cbr%3E%3Cbr%3E%0D%0ASo%2C+as+a+winning+bidder%2C+you+have+the+right+to+refuse+paying+if+you+are+only+awarded+a+partial+number+of+the+items+you+were+bidding+on.%3C%2Ffont%3E%0D%0A'),
